import React from 'react';
import './App.css';
import Button from 'react-bootstrap/Button';
import {Link} from 'react-router-dom';

function Nav(){
return  (
    <nav>
        
        <ul className="buttons2">
        <Link to="/">
            <Button variant="primary">Home</Button>{' '}
        </Link>
        <Link to="/tab">
             <Button variant="primary">Tabela</Button>{' '}
        </Link>
        <Link>
            <Button variant="primary">Tabela2</Button>{' '}
        </Link>
        
        

            
        </ul>




    </nav>
    )
}

export default Nav;
